import "./App.css";
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom';
import Home from "./pages/Home";
function App() {

  return (<div className="App">

    <Router>
      <Link> Home </Link>
      <Switch>
        <Route path="/" exact component={Home}/>
      </Switch>
    </Router>

  </div>);
}

export default App;
